function selectDate(e){
    MVUE.$store.commit('SET_CALEN',ysCalenTime(Cal_y.value,Cal_m.value,e))
    MVUE.$store.commit('SHOW_CALEN', false)
}
function ysCalenTime(n,i,t){var a=new Date,r=a.getHours(),y=a.getMinutes(),s=a.getSeconds();var jg=n<0||n>99?new Date(n,i-1,t,r,y,s).getTime():new Date(nilX(n,1)+"-"+nilX(i)+"-"+nilX(t)).getTime();return jg}


let upTotal = 1, upInd = 0, maxSize = 2000 * 1024, fileObj
const upImg = (dom='upFile') => {
    fileObj = document.getElementById(dom).files;
    upInd  = 0
    upTotal = fileObj.length

    upImgToB()
}

const upImgToB = () => {
    if(upInd<upTotal){
        const it=fileObj[upInd]
        if (it && it.type.indexOf("image") == 0) {
            // console.log(it)
            if (it.size > maxSize) {
                // 调用函数,对图片进行压缩
                compressImg(it, res => {
                    upImgTo({n:it.name, f:res})
                })
            } else {
                directTurnIntoBase64(it, res => {
                    upImgTo({n:it.name, f:res})
                });
            }
        }
        upInd += 1
    }

}


const upImgTo = (obj) => {
    const name = MVUE.$datex();
    MVUE.$post('file/upload',{type:'article', filename:name, file: obj.f, originalname: obj.n}).then( res=>{
        setTimeout( () =>{
            upImgToB()
        },2000)
        MVUE.$store.state.user.upimg = name
    }).catch(err =>{
        setTimeout( () =>{
            upImgToB()
        },2000)
        // this.$toast.error('上传失败请重试');
    })
}
